function Nav() {

    return (
        <div className="columns">
            <a className="navLink" href="/">
                About me
            </a>
            <a className="col navLink" href="/portfolio">
                Portfolio
            </a>
            <a className="col navLink" href="/contact">
                Contact Me
            </a>
        </div>
    )
}


export default Nav;
